import { Button, TextField, Typography } from "@mui/material";
import { Field, Form, Formik } from "formik";
import React from "react";
const initialValues = {
  email: "",
  password: "",
};
const LoginForm = () => {
  const handleSubmit = () => {};
  return (
    <div>
      <Typography variant="h5" className="text-center">
        login
      </Typography>
      <Formik initialValues={initialValues} onSubmit={handleSubmit}>
        <Form>
          {" "}
          <Field
            as={TextField}
            name="email"
            label="email"
            fullWidth
            margin="normal"
          />
          <Field
            as={TextField}
            name="password"
            label="password"
            fullWidth
            margin="normal"
          />
          <Button
            fullWidth
            type="submit"
            variant="contained"
            className=""
            sx={{ mt: 2, padding: "1rem" }}
          >
            login
          </Button>
        </Form>
      </Formik>
      <Typography>
        Don't have Account ?
        <Button onClick={() => Navigate("/account/register")}>Login</Button>
      </Typography>
    </div>
  );
};

export default LoginForm;
